- (void)insertCollegeWithName:(NSString *)name type:(NSString *)type city:(NSString *)city state:(NSString *)state region:(NSString *)region app:(NSString *)app acc:(NSString *)acc att:(NSString *)att add:(NSString *)add admis:(NSString *)admis fax:(NSString *)fax finAid:(NSString *)finAid email:(NSString *)email web:(NSString *)web schoolSize:(NSString *)schoolSize totUndEn:(NSString *)totUndEn mF:(NSString *)mF outState:(NSString *)outState pubHS:(NSString *)pubHS liveCamp:(NSString *)liveCamp frat:(NSString *)frat sor:(NSString *)sor afAm:(NSString *)afAm asian:(NSString *)asian cauc:(NSString *)cauc hisp:(NSString *)hisp nA:(NSString *)nA intNat:(NSString *)intNat countRep:(NSString *)countRep satCritRead:(NSString *)satCritRead satMath:(NSString *)satMath satWrite:(NSString *)satWrite actComp:(NSString *)actComp avHSGPA:(NSString *)avHSGPA top10:(NSString *)top10 top25:(NSString *)top25 top50:(NSString *)top50 tuit:(NSString *)tuit inTuit:(NSString *)inTuit outTuit:(NSString *)outTuit rBoard:(NSString *)rBoard reqFees:(NSString *)reqFees bkSup:(NSString *)bkSup studRecFinAid:(NSString *)studRecFinAid expense:(NSString *)expense totCost:(NSString *)totCost grad4:(NSString *)grad4 grad6:(NSString *)grad6 cal:(NSString *)cal studFac:(NSString *)studFac cClass:(NSString *)cClass cLab:(NSString *)cLab popMaj:(NSString *)popMaj favoriteStatus:(NSString *)favoriteStatus
{
