- (void)setupFetchedResultsController
{
    NSString *entityName = @"College";
    NSLog(@"Setting up a Fetched Results Controller for the Entity named %@", entityName);
    NSFetchRequest *request = [NSFetchRequest fetchRequestWithEntityName:entityName];
    request.sortDescriptors = [NSArray arrayWithObject:[NSSortDescriptor sortDescriptorWithKey:@"name"
                                                                                     ascending:YES
                                                                                      selector:@selector(localizedCaseInsensitiveCompare:)]];
    self.fetchedResultsController = [[NSFetchedResultsController alloc] initWithFetchRequest:request
                                                                        managedObjectContext:self.managedObjectContext
                                                                          sectionNameKeyPath:nil
                                                                                   cacheName:nil];
    [self.fetchedResultsController performFetch:nil];
}
- (BOOL)application:(UIApplication *)application didFinishLaunchingWithOptions:(NSDictionary *)launchOptions
{
    [self setupFetchedResultsController];
    if (![[self.fetchedResultsController fetchedObjects] count] > 0 ) {
        NSLog(@"!!!!! ~~> There's nothing in the database so defaults will be inserted");
        [self importCoreDataDefaultColleges];
    } else {
        NSLog(@"There's stuff in the database so skipping the import of default data");    
    }
    
    // Navigation Controllers on the Tab Bar (Indexes 0, 1, 2, 3, 4)
    // Change indexes if the tab order changes
    UITabBarController *tabBarController = (UITabBarController *)self.window.rootViewController;
    UINavigationController *collegeTableNav = [[tabBarController viewControllers] objectAtIndex:0];
    UINavigationController *stateTableNav = [[tabBarController viewControllers] objectAtIndex:1];
    UINavigationController *favoriteTableNav = [[tabBarController viewControllers] objectAtIndex:2];
    UINavigationController *filterTableNav = [[tabBarController viewControllers] objectAtIndex:3];
    UINavigationController *moreNav = [[tabBarController viewControllers] objectAtIndex:4];

    CollegeTable *collegeTable = [[collegeTableNav viewControllers] objectAtIndex:0];
    collegeTable.managedObjectContext = self.managedObjectContext;
    StateTable *stateTable = [[stateTableNav viewControllers] objectAtIndex:0];
    stateTable.managedObjectContext = self.managedObjectContext;
    FavoriteTable *favoriteTable = [[favoriteTableNav viewControllers] objectAtIndex:0];
    favoriteTable.managedObjectContext = self.managedObjectContext;    
    FilterTable *filterTable = [[filterTableNav viewControllers] objectAtIndex:0];
    filterTable.managedObjectContext = self.managedObjectContext;
    More *more = [[moreNav viewControllers] objectAtIndex:0];
    more.managedObjectContext = self.managedObjectContext;
    
    return YES;
}

